import logo from './logo.svg';
import {route, Router, Switch} from 'react-router-dom';
import React from 'react';
import LoginSignUp from './components/LoginSignup';
import './App.css';

function App() {
  return (
    <div>
      <router>
        <route path="/login" component={<LoginSignUp/>}/>
      </router>

    </div>
  );
}

export default App;
